import Typed from "typed.js";
import { useEffect, useRef } from "react";

const Writing = () => {
  // Create Ref element.
  const el = useRef(null);

  useEffect(() => {
    const typed = new Typed(el.current, {
      strings: ["Winners", "Fighter", "Legend"],
      startDelay: 300,
      typeSpeed: 150,
      backSpeed: 150,
      backDelay: 150,
      smartBackspace: true,
      loop: true,
      showCursor: false,
    });

    // Destropying
    return () => {
      typed.destroy();
    };
  }, []);

  return (

     
        <div className="Content">
          <h6>
           Tempus = <span ref={el}/>
                     </h6>
        
        </div>
  );
};
export default Writing  ;
